  function shuffleArray(array) {
    for (let i = array.length - 1; i > 0; i--) {
      const j = Math.floor(Math.random() * (i + 1)); // Random index
      [array[i], array[j]] = [array[j], array[i]]; // Swap elements
    }
    return array;
  }

  document.addEventListener('DOMContentLoaded', () => {
    const container = document.getElementById('container');

    const childByNode = new Map();

    shuffleArray(children).forEach((child) => {
      const childNode = document.createElement('div');
      childNode.className = 'child';
      childNode.innerText = child.name;

      container.appendChild(childNode);
      childByNode.set(childNode, child);
    });

    const handleMove = (e) => {
      const overlay = document.querySelector('.overlay');

      let target = e.target;
      let x;
      let y;

      // Handle touch events
      if (e.touches) {
        const touch = e.touches[0];
        target = document.elementFromPoint(touch.clientX, touch.clientY);
        x = touch.clientX;
        y = touch.clientY - 0.1 * window.innerHeight;
      } else {
        x = e.clientX;
        y = e.clientY;
      }

      if (target === container) {
        return;

        overlay.style = 'display: none';
      }

      const { name, age } = childByNode.get(target);
      overlay.style = `left: ${x}px; top: ${y}px; display: flex;`
      overlay.querySelector('.name').innerText = name;
      overlay.querySelector('.age').innerText = `${age} ${age === 1 ? 'year old' : 'years old'}`;
    };

    container.addEventListener('mousemove', handleMove);
    container.addEventListener('touchmove', handleMove);
